import{_ as e,c as t,o as i,a as o}from"./app.fb1780b6.js";const m='{"title":"Community Resources","description":"","frontmatter":{"sidebarDepth":2},"headers":[{"level":2,"title":"Official Channels","slug":"official-channels"},{"level":3,"title":"GitHub Repository","slug":"github-repository"},{"level":3,"title":"Telegram Group","slug":"telegram-group"},{"level":3,"title":"Discord Server","slug":"discord-server"},{"level":2,"title":"Community Support","slug":"community-support"},{"level":3,"title":"Getting Help","slug":"getting-help"},{"level":3,"title":"Reporting Issues","slug":"reporting-issues"},{"level":2,"title":"Contributing to Twoyi","slug":"contributing-to-twoyi"},{"level":3,"title":"Ways to Contribute","slug":"ways-to-contribute"},{"level":3,"title":"Development Resources","slug":"development-resources"},{"level":2,"title":"Community Projects","slug":"community-projects"},{"level":3,"title":"Third-Party Tools","slug":"third-party-tools"},{"level":3,"title":"Tutorials and Guides","slug":"tutorials-and-guides"},{"level":2,"title":"Community Events","slug":"community-events"},{"level":3,"title":"Online Meetups","slug":"online-meetups"},{"level":3,"title":"Hackathons","slug":"hackathons"},{"level":2,"title":"Community Guidelines","slug":"community-guidelines"},{"level":2,"title":"Recognition and Rewards","slug":"recognition-and-rewards"},{"level":2,"title":"Stay Connected","slug":"stay-connected"}],"relativePath":"guide/community.md","lastUpdated":1746534938333}',r={},n=o('<h1 id="community-resources" tabindex="-1">Community Resources <a class="header-anchor" href="#community-resources" aria-hidden="true">#</a></h1><p>Twoyi has a growing community of users and developers who share knowledge, provide support, and contribute to the project. This page provides information about community resources and how to get involved.</p><h2 id="official-channels" tabindex="-1">Official Channels <a class="header-anchor" href="#official-channels" aria-hidden="true">#</a></h2><h3 id="github-repository" tabindex="-1">GitHub Repository <a class="header-anchor" href="#github-repository" aria-hidden="true">#</a></h3><p>The official GitHub repository is the primary hub for Twoyi development:</p><ul><li><strong>Main Repository</strong>: <a href="https://github.com/twoyi/twoyi" target="_blank" rel="noopener noreferrer">https://github.com/twoyi/twoyi</a></li><li><strong>Documentation Repository</strong>: <a href="https://github.com/twoyi/twoyi.github.io" target="_blank" rel="noopener noreferrer">https://github.com/twoyi/twoyi.github.io</a></li></ul><p>On GitHub, you can:</p><ul><li>Report issues and bugs</li><li>Submit feature requests</li><li>Contribute code through pull requests</li><li>Track development progress</li><li>Download the latest releases</li></ul><h3 id="telegram-group" tabindex="-1">Telegram Group <a class="header-anchor" href="#telegram-group" aria-hidden="true">#</a></h3><p>Join our official Telegram group to connect with other Twoyi users and developers:</p><ul><li><strong>Telegram Group</strong>: <a href="https://t.me/twoyi_group" target="_blank" rel="noopener noreferrer">https://t.me/twoyi_group</a></li></ul><p>The Telegram group is a great place to:</p><ul><li>Get help with issues</li><li>Share your experiences</li><li>Discuss features and use cases</li><li>Connect with other users</li><li>Get announcements about new releases</li></ul><h3 id="discord-server" tabindex="-1">Discord Server <a class="header-anchor" href="#discord-server" aria-hidden="true">#</a></h3><p>We also maintain a Discord server for real-time discussions:</p><ul><li><strong>Discord Server</strong>: <a href="https://discord.gg/twoyi" target="_blank" rel="noopener noreferrer">https://discord.gg/twoyi</a></li></ul><p>The Discord server includes channels for:</p><ul><li>General discussion</li><li>Technical support</li><li>Development chat</li><li>Feature requests</li><li>Showcase your Twoyi setups</li></ul><h2 id="community-support" tabindex="-1">Community Support <a class="header-anchor" href="#community-support" aria-hidden="true">#</a></h2><h3 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-hidden="true">#</a></h3><p>If you need help with Twoyi, there are several resources available:</p><ol><li><strong>Documentation</strong>: Start with this documentation site, which covers most aspects of using Twoyi</li><li><strong>GitHub Issues</strong>: Search existing issues to see if your problem has been reported</li><li><strong>Community Forums</strong>: Ask questions in the Telegram group or Discord server</li><li><strong>Stack Overflow</strong>: Use the tag <code>twoyi</code> when asking questions on Stack Overflow</li></ol><h3 id="reporting-issues" tabindex="-1">Reporting Issues <a class="header-anchor" href="#reporting-issues" aria-hidden="true">#</a></h3><p>When reporting issues, please include:</p><ul><li>A clear description of the problem</li><li>Steps to reproduce the issue</li><li>Your device information (model, Android version)</li><li>Twoyi version</li><li>Screenshots or logs if applicable</li></ul><p>The more information you provide, the easier it will be for the community to help you.</p><h2 id="contributing-to-twoyi" tabindex="-1">Contributing to Twoyi <a class="header-anchor" href="#contributing-to-twoyi" aria-hidden="true">#</a></h2><h3 id="ways-to-contribute" tabindex="-1">Ways to Contribute <a class="header-anchor" href="#ways-to-contribute" aria-hidden="true">#</a></h3><p>There are many ways to contribute to the Twoyi project:</p><h4 id="code-contributions" tabindex="-1">Code Contributions <a class="header-anchor" href="#code-contributions" aria-hidden="true">#</a></h4><ul><li>Fix bugs or implement new features</li><li>Improve performance or stability</li><li>Add support for new Android versions</li><li>Enhance the user interface</li></ul><p>See the <a href="/guide/contributing.html">Contributing Guide</a> for detailed information on how to contribute code.</p><h4 id="documentation-contributions" tabindex="-1">Documentation Contributions <a class="header-anchor" href="#documentation-contributions" aria-hidden="true">#</a></h4><ul><li>Improve existing documentation</li><li>Add new guides or tutorials</li><li>Translate documentation to other languages</li><li>Fix errors or clarify instructions</li></ul><p>To contribute to documentation, submit pull requests to the <a href="https://github.com/twoyi/twoyi.github.io" target="_blank" rel="noopener noreferrer">documentation repository</a>.</p><h4 id="testing-and-feedback" tabindex="-1">Testing and Feedback <a class="header-anchor" href="#testing-and-feedback" aria-hidden="true">#</a></h4><ul><li>Test new features and releases</li><li>Report bugs and issues</li><li>Provide feedback on user experience</li><li>Suggest improvements</li></ul><h4 id="community-support-1" tabindex="-1">Community Support <a class="header-anchor" href="#community-support-1" aria-hidden="true">#</a></h4><ul><li>Help answer questions from other users</li><li>Share your knowledge and experiences</li><li>Create tutorials or guides</li><li>Promote Twoyi to others who might benefit from it</li></ul><h3 id="development-resources" tabindex="-1">Development Resources <a class="header-anchor" href="#development-resources" aria-hidden="true">#</a></h3><p>If you&#39;re interested in contributing to Twoyi development, these resources will help you get started:</p><ul><li><a href="/guide/architecture.html">Architecture Overview</a>: Understand how Twoyi works</li><li><a href="/guide/contributing.html#development-setup">Development Setup Guide</a>: Set up your development environment</li><li><a href="/guide/contributing.html#coding-guidelines">Coding Guidelines</a>: Follow the project&#39;s coding standards</li><li><a href="/guide/contributing.html#pull-request-process">Pull Request Process</a>: Learn how to submit your contributions</li></ul><h2 id="community-projects" tabindex="-1">Community Projects <a class="header-anchor" href="#community-projects" aria-hidden="true">#</a></h2><h3 id="third-party-tools" tabindex="-1">Third-Party Tools <a class="header-anchor" href="#third-party-tools" aria-hidden="true">#</a></h3><p>Community members have created various tools and extensions for Twoyi:</p><ul><li><strong>Custom ROMs</strong>: Modified versions of the Twoyi ROM with additional features</li><li><strong>Automation Scripts</strong>: Scripts to automate common tasks in Twoyi</li><li><strong>Integration Tools</strong>: Tools to integrate Twoyi with other applications</li></ul><p>If you&#39;ve created a tool or project related to Twoyi, share it in the community channels!</p><h3 id="tutorials-and-guides" tabindex="-1">Tutorials and Guides <a class="header-anchor" href="#tutorials-and-guides" aria-hidden="true">#</a></h3><p>Community-created tutorials and guides can be found on:</p><ul><li><strong>YouTube</strong>: Search for &quot;Twoyi tutorial&quot; for video guides</li><li><strong>Medium</strong>: Articles about using and customizing Twoyi</li><li><strong>XDA Developers</strong>: Threads discussing Twoyi features and modifications</li></ul><h2 id="community-events" tabindex="-1">Community Events <a class="header-anchor" href="#community-events" aria-hidden="true">#</a></h2><h3 id="online-meetups" tabindex="-1">Online Meetups <a class="header-anchor" href="#online-meetups" aria-hidden="true">#</a></h3><p>Periodically, we organize online meetups for the Twoyi community:</p><ul><li><strong>Developer Q&amp;A Sessions</strong>: Ask questions directly to the developers</li><li><strong>Feature Demonstrations</strong>: See new features in action</li><li><strong>Community Showcases</strong>: Share your Twoyi setups and use cases</li></ul><p>Watch the official channels for announcements about upcoming events.</p><h3 id="hackathons" tabindex="-1">Hackathons <a class="header-anchor" href="#hackathons" aria-hidden="true">#</a></h3><p>Occasionally, we organize hackathons to encourage development of new features and tools for Twoyi:</p><ul><li><strong>Feature Challenges</strong>: Implement specific features or improvements</li><li><strong>Bug Fixing Sprints</strong>: Focus on fixing known issues</li><li><strong>Documentation Improvements</strong>: Enhance and expand the documentation</li></ul><h2 id="community-guidelines" tabindex="-1">Community Guidelines <a class="header-anchor" href="#community-guidelines" aria-hidden="true">#</a></h2><p>To ensure a positive and productive community environment, please follow these guidelines:</p><ol><li><strong>Be Respectful</strong>: Treat all community members with respect and courtesy</li><li><strong>Stay On Topic</strong>: Keep discussions relevant to Twoyi and related topics</li><li><strong>No Spam</strong>: Avoid excessive self-promotion or off-topic links</li><li><strong>Help Others</strong>: Share your knowledge and help others when you can</li><li><strong>Provide Context</strong>: When asking for help, provide sufficient information</li><li><strong>Follow Platform Rules</strong>: Adhere to the rules of each platform (GitHub, Telegram, Discord)</li></ol><h2 id="recognition-and-rewards" tabindex="-1">Recognition and Rewards <a class="header-anchor" href="#recognition-and-rewards" aria-hidden="true">#</a></h2><p>We recognize and appreciate community contributions:</p><ul><li><strong>Contributors List</strong>: Active contributors are listed in the project&#39;s README</li><li><strong>Feature Credits</strong>: Significant features include credits to their contributors</li><li><strong>Community Highlights</strong>: Outstanding contributions are highlighted in release notes</li></ul><h2 id="stay-connected" tabindex="-1">Stay Connected <a class="header-anchor" href="#stay-connected" aria-hidden="true">#</a></h2><p>To stay updated on Twoyi development and community activities:</p><ul><li><strong>Star the Repository</strong>: Star the <a href="https://github.com/twoyi/twoyi" target="_blank" rel="noopener noreferrer">GitHub repository</a> to receive notifications</li><li><strong>Join Communication Channels</strong>: Join the Telegram group and Discord server</li><li><strong>Watch Releases</strong>: Watch the repository for release notifications</li><li><strong>Follow on Social Media</strong>: Follow Twoyi on social media platforms</li></ul><p>We look forward to your participation in the Twoyi community!</p>',68),s=[n];function a(l,u,d,h,c,p){return i(),t("div",null,s)}var y=e(r,[["render",a]]);export{m as __pageData,y as default};
